import React from 'react';
import { FloatButton  } from 'antd';
import { PlusCircleFilled,QuestionCircleOutlined, SyncOutlined} from '@ant-design/icons';


export const Flobott = () => (
    <>
    <FloatButton.Group
      shape="circle"
      style={{
        right: 24,
      }}
    >
      <FloatButton icon={<PlusCircleFilled />} />
      <FloatButton />
      <FloatButton.BackTop visibilityHeight={0} />
    </FloatButton.Group>
    <FloatButton.Group
      shape="square"
      style={{
        right: 94,
      }}
    >
      <FloatButton icon={<QuestionCircleOutlined />} />
      <FloatButton />
      <FloatButton icon={<SyncOutlined />} />
      <FloatButton.BackTop visibilityHeight={0} />
    </FloatButton.Group>

    <FloatButton icon={<PlusCircleFilled />} />
      <FloatButton />
  </>
)
